import React from 'react'
import {AppBar,Toolbar} from '@mui/material';
import AddUsers from './AddUsers.';

function NavBar() {
  return (
    <>
        <AppBar>
        <Toolbar>
           <h3>AddUser</h3>
           <h3>AllUser</h3>
           <h3>EditUser</h3>
           <AddUsers/>
           
        </Toolbar>
        </AppBar>
    </>
  )
}

export default NavBar
